cing: 0; }\n	div.csc-textpic .csc-textpic-imagewrap table tr td { padding: 0; vertical-align: top; }\n\n	/* Settings for figure and figcaption (HTML5) */\n	div.csc-textpic .csc-textpic-imagewrap figure, div.csc-textpic figure.csc-textpic-imagewrap { margin: 0; display: table; }\n\n	/* Captions */\n	figcaption.csc-textpic-caption { display: table-caption; }\n	.csc-textpic-caption { text-align: left; caption-side: bottom; }\n	div.csc-textpic-caption-c .csc-textpic-caption, .csc-textpic-imagewrap .csc-textpic-caption-c { text-align: center; }\n	div.csc-textpic-caption-r .csc-textpic-caption, .csc-textpic-imagewrap .csc-textpic-caption-r { text-align: right; }\n	div.csc-textpic-caption-l .csc-textpic-caption, .csc-textpic-imagewrap .csc-textpic-caption-l { text-align: left; }\n\n	/* Float the columns */\n	div.csc-textpic div.csc-textpic-imagecolumn { float: left; }\n\n	/* Border just around the image */\n	div.csc-textpic-border div.csc-textpic-imagewrap img {\n		border: 2px solid black;\n		padding: 0px 0px;\n	}\n\n	div.csc-textpic .csc-textpic-imagewrap img { border: none; display: block; }\n\n	/* Space below each image (also in-between rows) */\n	div.csc-textpic .csc-textpic-imagewrap .csc-textpic-image { margin-bottom: 10px; }\n	div.csc-textpic .csc-textpic-imagewrap .csc-textpic-imagerow-last .csc-textpic-image { margin-bottom: 0; }\n\n	/* colSpace around image columns, except for last column */\n	div.csc-textpic-imagecolumn, td.csc-textpic-imagecolumn .csc-textpic-image { margin-right: 10px; }\n	div.csc-textpic-imagecolumn.csc-textpic-lastcol, td.csc-textpic-imagecolumn.csc-textpic-lastcol .csc-textpic-image { margin-right: 0; }\n\n	/* Add margin from image-block to text (in case of \"Text & Images\") */\n	div.csc-textpic-intext-left .csc-textpic-imagewrap,\n	div.csc-textpic-intext-left-nowrap .csc-textpic-imagewrap {\n		margin-right: 10px;\n	}\n	div.csc-textpic-intext-right .csc-textpic-imagewrap,\n	div.csc-textpic-intext-right-nowrap .csc-textpic-imagewrap {\n		margin-left: 10px;\n	}\n\n	/* Positioning of images: */\n\n	/* Center (above or below) */\n	div.csc-textpic-center .csc-textpic-imagewrap, div.csc-textpic-center figure.csc-textpic-imagewrap { overflow: hidden; }\n	div.csc-textpic-center .csc-textpic-center-outer { position: relative; float: right; right: 50%; }\n	div.csc-textpic-center .csc-textpic-center-inner { position: relative; float: right; right: -50%; }\n\n	/* Right (above or below) */\n	div.csc-textpic-right .csc-textpic-imagewrap { float: right; }\n	div.csc-textpic-right div.csc-textpic-text { clear: right; }\n\n	/* Left (above or below) */\n	div.csc-textpic-left .csc-textpic-imagewrap { float: left; }\n	div.csc-textpic-left div.csc-textpic-text { clear: left; }\n\n	/* Left (in text) */\n	div.csc-textpic-intext-left .csc-textpic-imagewrap { float: left; }\n\n	/* Right (in text) */\n	div.csc-textpic-intext-right .csc-textpic-imagewrap { float: right; }\n\n	/* Right (in text, no wrap around) */\n	div.csc-textpic-intext-right-nowrap .csc-textpic-imagewrap { float: right; }\n\n	/* Left (in text, no wrap around) */\n	div.csc-textpic-intext-left-nowrap .csc-textpic-imagewrap { float: left; }\n\n	div.csc-textpic div.csc-textpic-imagerow-last, div.csc-textpic div.csc-textpic-imagerow-none div.csc-textpic-last { margin-bottom: 0; }\n\n	/* Browser fixes: */\n\n	/* Fix for unordered and ordered list with image \"In text, left\" */\n	.csc-textpic-intext-left ol, .csc-textpic-intext-left ul { padding-left: 40px; overflow: auto; }\n\n	/* File Links */\n	ul.csc-uploads { padding: 0; }\n	ul.csc-uploads li { list-style: none outside none; margin: 1em 0; }\n	ul.csc-uploads img { float: left; margin-right: 1em; vertical-align: top; }\n	ul.csc-uploads span { display: block; }\n	ul.csc-uploads span.csc-uploads-fileName { text-decoration: underline; }\n\n	/* Table background colors: */\n\n	table.contenttable-color-1 { background-color: #EDEBF1; }\n	table.contenttable-color-2 { background-color: #F5FFAA; }\n	table.contenttable-color-240 { background-color: black; }\n	table.contenttable-color-241 { background-color: white; }\n	table.contenttable-color-242 { background-color: #333333; }\n	table.contenttable-color-243 { background-color: gray; }\n	table.contenttable-color-244 { background-color: silver; }\";}s:8:\"tx_form.\";a:4:{s:5:\"view.\";a:4:{s:16:\"elementPartials.\";a:23:{s:7:\"BUTTON.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:19:\"FlatElements/Button\";}}s:10:\"BUTTONTAG.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:22:\"FlatElements/ButtonTag\";}}s:9:\"CHECKBOX.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:21:\"FlatElements/Checkbox\";}}s:14:\"CHECKBOXGROUP.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:31:\"ContainerElements/Checkboxgroup\";}}s:15:\"CONTENTELEMENT.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:27:\"FlatElements/ContentElement\";}}s:9:\"FIELDSET.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:26:\"ContainerElements/Fieldset\";}}s:11:\"FILEUPLOAD.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:19:\"FlatElements/Upload\";}}s:5:\"FORM.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:22:\"ContainerElements/Form\";}}s:7:\"HEADER.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:19:\"FlatElements/Header\";}}s:7:\"HIDDEN.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:19:\"FlatElements/Hidden\";}}s:12:\"IMAGEBUTTON.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:24:\"FlatElements/Imagebutton\";}}s:6:\"INPUT.\";a:1:{s:3:\"10.\";a:2:{s:11:\"displayName\";s:7:\"Default\";s:11:\"partialPath\";s:18:\"FlatElements/Input\";}}s:16:\"INPUTTYPEBUTTON.\";a:1:{s:3:\"10.\";a:2:{s